import React, { useState } from 'react';
import apiService from '../services/api';
import emailService from '../services/emailService';

const Header: React.FC = () => {
  const [showForm, setShowForm] = useState(false);
  const [formData, setFormData] = useState({
    name: '',
    phone: ''
  });
  const [submitting, setSubmitting] = useState(false);

  const handleBookSafetyCall = () => {
    // Close any open card forms by dispatching a custom event
    window.dispatchEvent(new CustomEvent('closeCardForms'));
    setShowForm(true);
  };

  const handleCloseForm = () => {
    setShowForm(false);
    setFormData({ name: '', phone: '' });
  };

  const handleInputChange = (field: string, value: string) => {
    setFormData(prev => ({
      ...prev,
      [field]: value
    }));
  };

  const handleFormSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setSubmitting(true);
    
    try {
      // Submit form data to API
      await apiService.createSafetyCall({
        product_id: null,
        customer_name: formData.name,
        phone_number: formData.phone,
        email: '',
        form_data: formData
      });

      // Send email notification
      await emailService.sendFormspreeNotification({
        product_id: null,
        customer_name: formData.name,
        phone_number: formData.phone,
        email: '',
        form_data: formData
      });

      // Close form and reset
      setShowForm(false);
      setFormData({ name: '', phone: '' });
    } catch (error) {
      console.error('Error submitting form:', error);
    } finally {
      setSubmitting(false);
    }
  };

  return (
    <>
      <header className="flex justify-between items-center py-8">
        {/* Logo */}
        <div className="flex items-center">
          <img 
            src="/images/logo-favicon.png" 
            alt="Nicsan Insurance" 
            className="w-[71px] h-[52px]"
          />
        </div>

        {/* Navigation */}
        <div className="flex items-center gap-9">
          {/* Products Dropdown */}
          

          {/* Book Safety Call Button */}
          <button 
            onClick={handleBookSafetyCall}
            className="bg-primary-blue text-button-text font-satoshi font-bold px-5 py-3.5 rounded-[10px] hover:bg-[#012E58] transition-colors"
          >
            Book Safety Call
          </button>
        </div>
      </header>

      {/* Form Overlay */}
      {showForm && (
        <div className="fixed inset-0 bg-black bg-opacity-50 z-50 flex items-center justify-center">
          <div className="bg-light-gray p-6 w-full max-w-md rounded-[24px] overflow-hidden">
            {/* Form Header */}
            <div className="flex justify-between items-start mb-4">
              <h3 className="font-satoshi font-normal text-[28px] text-design-black leading-[1.16em]">
                Book Safety Call
              </h3>
              <button 
                onClick={handleCloseForm}
                className="text-design-black hover:text-gray-600"
              >
                âœ•
              </button>
            </div>

            {/* Form Content */}
            <form onSubmit={handleFormSubmit} className="space-y-4">
              <div>
                <label className="block font-satoshi font-normal text-[15px] text-design-black mb-2">
                  Name:
                </label>
                <input 
                  type="text"
                  className="w-full px-4 py-3 bg-white rounded-[8px] border border-gray-300 focus:outline-none focus:border-primary-blue text-[15px]"
                  placeholder="Enter your full name"
                  value={formData.name}
                  onChange={(e) => handleInputChange('name', e.target.value)}
                  required
                />
              </div>

              <div>
                <label className="block font-satoshi font-normal text-[15px] text-design-black mb-2">
                  Phone No.:
                </label>
                <input 
                  type="tel"
                  className="w-full px-4 py-3 bg-white rounded-[8px] border border-gray-300 focus:outline-none focus:border-primary-blue text-[15px]"
                  placeholder="Enter your phone number"
                  value={formData.phone}
                  onChange={(e) => handleInputChange('phone', e.target.value)}
                  required
                />
              </div>

              {/* Form Buttons */}
              <div className="flex gap-3 pt-4">
                <button 
                  type="button"
                  onClick={handleCloseForm}
                  disabled={submitting}
                  className="flex-1 text-design-black font-satoshi font-bold px-4 py-3 rounded-[10px] border-2 border-design-black hover:bg-gray-100 transition-colors text-[15px] disabled:opacity-50"
                >
                  Cancel
                </button>
                <button 
                  type="submit"
                  disabled={submitting}
                  className="flex-1 bg-primary-blue text-button-text font-satoshi font-bold px-4 py-3 rounded-[10px] hover:bg-[#012E58] transition-colors text-[15px] shadow-md disabled:opacity-50"
                >
                  {submitting ? 'Submitting...' : 'Schedule Safety Call'}
                </button>
              </div>
            </form>
          </div>
        </div>
      )}
    </>
  );
};

export default Header;
